/** *	TestTab navigator * *	@param title string *	@param url URL optional ***/ServiceClient.jquery.navigator.TestTab = function(config){	return [{		service : ServiceClient.jquery.view.TabUIAdd,		tabui : 'tabuipanel',		tabtitle : config.title || 'Testing'	},{		service : ServiceClient.jquery.loader.AjaxLoader,		loadurl : config.url || 'data.json.php',		workflow : [{			service : ServiceClient.jquery.module.ReadTemplate,			tpl : config.tpl || 'tpl-test'		},{			service : ServiceClient.jquery.module.ApplyTemplate,		},{			service : ServiceClient.jquery.renderer.ContentUI		}]	}];}